import React from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
 import "../Styles/navstyle.css"
const SideNavbar = () => {
  return (
    <Navbar variant="dark" className="sidebar">
      <Nav className="flex-column me-auto">
        <Nav.Link as={NavLink} to="/Home" activeClassName="active">
          Home
        </Nav.Link>
        <Nav.Link as={NavLink} to="/New" activeClassName="active">
          New Reg
        </Nav.Link>
        <Nav.Link as={NavLink} to="/ToDoList" activeClassName="active">
          ToDoList
        </Nav.Link>
      </Nav>
    </Navbar>
  );
};

export default SideNavbar;
